import Book from "./Book"

export function SearchResults({ results, updateBook, shelves }) {
    if (results) {
    return (
        <div>
            <div className="search-books-results">
                <ol className="books-grid">
                { results.length > 0
                    ? results.map((book) => {
                        return (
                            <Book 
                                key={book.id} 
                                book={book}
                                updateBook={updateBook}
                                shelves={shelves}
                            />)
                        })
                    : `No results`
                    }
                </ol>
            </div>
        </div>
    )
    } else {
        return <div></div>
    }
}
